import { Link } from "react-router-dom";
import Header3 from './Header3';

function Navigation(){
    return(
        <>
            <nav>
                <ul>
                    <li>
                        <Link to ="/">Home</Link>
                    </li>
                    <li>
                        <Link to ="/world-news">World</Link>
                    </li>
                </ul>
            </nav>
            <Header3 />
        </>
    )
}

export default Navigation;
